Than this on Tuesday June 22nd, with Amelia Abraham, Shon Faye, Yasmin Benoit, Adam Eli and more. Info hereWe talk about achieving 'LGBTQ+ equality', but around the world, LGBTQ+ people are still suffering discrimination and extreme violence. How do we solve this urgent problem, allowing queer people everywhere the opportunity to thrive?In We Can Do Better Than This, 35 voices explore this question. Through deeply moving stories and provocative new arguments on safety and visibility, dating and gender, care and community, they map new global frontiers in the fight for LGBTQ+ rights.Pabllo Vittar pleads for the end of hate murders, Olly Alexander champions inclusive sex education in schools, and Beth Ditto calls for a revolution in representation. Elsewhere, Mykki Blanco se\",\"unwound_url\":\"https://www.gaystheword.co.uk/product-page/we-can-do-better-than-this-ed-by-amelia-abraham\"},{\"start\":286,\"end\":309,\"url\":\"https://t.co/wuqMqq4VWf\",\"expanded_url\":\"https://twitter.com/gaystheword/status/1400426613548929035/photo/1\",\"display_url\":\"pic.twitter.com/wuqMqq4VWf\"}],\"mentions\":[{\"start\":17,\"end\":30,\"username\":\"MillyAbraham\",\"id\":\"604665555\"},{\"start\":130,\"end\":143,\"username\":\"vintagebooks\",\"id\":\"18900771\"}]},\"lang\":\"en\",\"id\":\"1400426613548929035\",\"text\":\"Happy pub day to @MillyAbraham &amp; each &amp; every contributor to the NECESSARY and VITAL anthology We Can Do Better Than This @vintagebooks \\nHow can we create a better world for LGBTQ+ people? 35 extraordinary voices share stories and visions for the future https://t.co/DGPJSwGycO https://t.co/wuqMqq4VWf\",\"conversation_id\":\"1400426613548929035\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":17,\"reply_count\":1,\"like_count\":66,\"quote_count\":3},\"created_at\":\"2021-06-03T12:18:17.000Z\",\"author_id\":\"156265400\"},{\"source\":\"Twitter for iPhone\",\"attachments\":{\"media_keys\":[\"3_1400500283973718021\"]},\"entities\":{\"urls\