 is my birthday and I’m still playing with @LEGO_Group - especially when it’s #pride LEGO!!! @matthew__ashton thank you so much for bringing this into existence and being a total gem \\uD83E\\uDD73\\uD83C\\uDFF3️‍\\uD83C\\uDF08\\uD83D\\uDC95\\n\\n#EveryONEisAwesome #birthday #lego #lgbtpride https://t.co/sWjsCR4dxw\",\"conversation_id\":\"1400375689312882689\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":8,\"reply_count\":30,\"like_count\":365,\"quote_count\":2},\"created_at\":\"2021-06-03T08:55:56.000Z\",\"author_id\":\"24249432\"},{\"source\":\"Twitter for Android\",\"lang\":\"en\",\"id\":\"1400388524843601924\",\"text\":\"@philford I'm hearing you. These light mornings are the worst. Pru was jumping on my head at 4.30 this morning\",\"entities\":{\"mentions\":[{\"start\":0,\"end\":9,\"username\":\"philford\",\"id\":\"20356950\"}]},\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1400383123326636033\"}],\"conversation_id\":\"1400383123326636033\",\"possibly_sensitive\":false,\"in_reply_to_user_id\":\"20356950\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"created_at\":\"2021-06-03T09:46:56.000Z\",\"author_id\":\"141710372\"},{\"entities\":{\"annotations\":[{\"start\":85,\"end\":89,\"probability\":0.9152,\"type\":\"Person\",\"normalized_text\":\"Conte\"},{\"start\":97,\"end\":113,\"probability\":0.3278,\"type\":\"Organization\",\"normalized_text\":\"Tinpot club spurs\"}]},\"source\":\"Twitter for iPhone\",\"lang\":\"en\",\"id\":\"1400386078260051968\",\"text\":\"I won’t believe it until I see a here we go BUT how on earth have we managed to pull Conte off?? Tinpot club spurs yeah \\uD83E\\uDD23 buzzing\",\"conversation_id\":\"1400386078260051968\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":0,\"reply_count\":3,\"like_count\":27,\"quote_count\":0},\"created_at\":\"2021-06-03T09:37:13.000Z\",\"author_id\":\"222868201\"},{\"entities\":{\"annotations\":[{\"start\":14,\"end\":26,\"probability\":0.9656,\"type\":\"Person\",\"normalized_text\":\"Billie Eilish\"}],\"urls\":[{\"start\":255,\"end\":278,\"url\":\"https://t.co/ESQR9MO7uU\",\"expanded_url\":\"https://twitter.com/JoaoCadide/status/1400381126405918722/photo/1\",\"display_url\":\"pic.twitter.com/ESQR9MO7uU\"}]},\"source\":\"Twitter for iPhone\",\"attachments\":{\"media_keys\":[\"16_1400381119934210049\"]},\"lang\":\"en\",\"id\":\"1400381126405918722\",\"text\":\"My issue with Billie Eilish is this: when you see this GIF, you probably think that it’s an upbeat song and she’s singing very high note verses, right?\\n\\nWhen you hear the actual song, she’s whispering and the song has a very quiet vibe??!\\n\\nWhat gives?!?! https://t.co/ESQR9MO7uU\",\"conversation_id\":\"1400381126405918722\",\"possibly_sensitive\":false,\"geo\":{\"place_id\":\"695b360b8171c433\"},\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"created_at\":\"2021-06-03T09:17:33.000Z\",\"author_id\":\"28388322\"},{\"source\":\"Twitter for iPhone\",\"attachments\":{\"media_keys\":[\"3_1400341605807267841\"]},\"entities\":{\"urls\":[{\"start\":117,\"end\":140,\"url\":\"https://t.co/uARUeD8dsI\",\"expanded_url\":\"https://twitter.com/LeatherSamFin/status/1400341610756460547/photo/1\",\"display_url\":\"pic.twitter.com/uARUeD8dsI\"}]},\"lang\":\"en\",\"id\":\"1400341610756460547\",\"text\":\"It’s my annual getting older day today. I’m starting this new year in my life by relaxing in rubber in a hammock. \\uD83D\\uDE0E\\uD83E\\uDD73 https://t.co/uARUeD8dsI\",\"conversation_id\":\"1400341610756460547\",\"possibly_sensitive\":true,\"public_metrics\":{\"retweet_count\":3,\"reply_count\":9,\"like_count\":65,\"quote_count\":0},\"created_at\":\"2021-06-03T06:40:31.000Z\",\"author_id\":\"942884402291494913\"},{\"source\":\"Buffer\",\"attachments\":{\"media_keys\":[\"3_1400342752790036483\"]},\"entities\":{\"urls\":[{\"start\":251,\"end\":274,\"url\":\"https://t.co/GlENSL5JPJ\"