bly still \\uD83D\\uDE34\\uD83D\\uDE34) \\uD83D\\uDE18\\uD83D\\uDE18\\uD83D\\uDE18\\uD83D\\uDE18xxxx\",\"entities\":{\"mentions\":[{\"start\":37,\"end\":51,\"username\":\"MetMattTaylor\",\"id\":\"163996026\"}]},\"conversation_id\":\"1400346180903706629\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":8,\"reply_count\":26,\"like_count\":648,\"quote_count\":1},\"created_at\":\"2021-06-03T06:58:41.000Z\",\"author_id\":\"145538207\"},{\"source\":\"Twitter for iPhone\",\"lang\":\"en\",\"id\":\"1400163409002434564\",\"text\":\"Today has been overwhelming to say the least but I have been so moved by all your comments.\\nI’m incredibly proud of our show &amp; what it stands for.\\nThe inclusivity, the representation, the physical &amp; mental health issues raised &amp; all between.\\nIt has heart.\\nAnd that’s rare. ❤️\",\"conversation_id\":\"1400163409002434564\",\"possibly_sensitive\":false,\"public_metrics\":{\"retweet_count\":140,\"reply_count\":403,\"like_count\":5641,\"quote_count\":23},\"created_at\":\"2021-06-02T18:52:25.000Z\",\"author_id\":\"22914617\"},{\"entities\":{\"annotations\":[{\"start\":12,\"end\":14,\"probability\":0.82,\"type\":\"Person\",\"normalized_text\":\"Caz\"}],\"mentions\":[{\"start\":0,\"end\":8,\"username\":\"The_Caz\",\"id\":\"20014462\"}]},\"source\":\"Twitter for Android\",\"lang\":\"en\",\"id\":\"1400344670748692483\",\"text\":\"@The_Caz Hi Caz\\nI've got my money back. Many thanks for your help\\nHopefully\\nLatitude will return to its former glories in 2022\\nBest wishes\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1397950717671903233\"}],\"conversation_id\":\"1397839998909444096\",\"possibly_sensitive\":false,\"in_reply_to_user_id\":\"20014462\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"created_at\":\"2021-06-03T06:52:41.000Z\",\"author_id\":\"1182795997\"},{\"source\":\"Twitter for iPhone\",\"attachments\":{\"media_keys\":[\"3_1398333103664467975\"]